import Dog from "./Dog";
import React, { useState } from "react";

const DogList = (props) => {
  const dogs = props.dogs.map((dog) => {
    return (
      <li key={dog.id} className="dogList">
        <Dog dogs={dog} />
      </li>
    );
  });
  return (
    <>
      <img className="" src={props.dog.url} alt={"photo" + props.dog.name} />
      <h4> {props.dog.name} </h4> <p> {props.dog.description} </p>
    </>
  );
};

export default DogList;
